你可以通过复制下面的代码来实现：

```javascript
function playAudio(url) {
  const audio = new Audio(url);
  audio.play();
}

// Example usage
playAudio('https://example.com/audio.mp3');
```

然后你可以这样使用它：

```javascript
const audioUrl = 'https://example.com/audio.mp3';
playAudio(audioUrl);
```

这样就可以播放音频文件了。
